  render(){
    <>
<div className="mb-2">
  <Button variant="primary" size="lg">
    Inventory
  </Button>{' '}{' '}
  <Button variant="secondary" size="lg">
   Suppliers
  </Button>{' '}
  <Button variant="primary" size="lg">
    Add New Suppliers
  </Button>{' '}
  <Button variant="secondary" size="lg">
    Add New Inventory
  </Button>{' '}
  <Button variant="primary" size="lg">
    Edit Inventory
  </Button>{' '}
  <Button variant="secondary" size="lg">
    Edit Suppliers
  </Button>
    <div>
      <input type="text" id="inputText"/>
      <button>Submit</button>
    </div>


</div>
</>
  }
}


export default HomepageContent;
